import React from 'react';
import {Provider} from 'react-redux';
import store from './store';
import {HashRouter} from "react-router-dom";

import './App.css';

const App = () => {

    return (
        <Provider store={store}>
            <HashRouter>
                <div className="container">
                </div>
            </HashRouter>
        </Provider>
    );
};

export default App;
